import "./ERC721A.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/finance/PaymentSplitter.sol";
import "@openzeppelin/contracts/utils/cryptography/MerkleProof.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

contract MetaMindGames is ERC721A, Ownable, PaymentSplitter,ReentrancyGuard{
    using Strings for uint256;

    uint256 public constant MAX_SUPPLY = 404;
    uint256 public constant MAX_TEAM_MINT = 20;
    uint256 public constant MAX_PER_ADRESS_PUBLIC_MINT = 20;
    uint256 public constant MAX_PER_ADRESS_GEN1_MINT = 1;
    uint256 public constant MAX_PER_ADRESS_GEN2_MINT = 1;
    uint256 public constant PUBLIC_SALE_PRICE = .05 ether;
    uint256 public constant GEN1_SALE_PRICE = .05 ether;
    uint256 public constant GEN2_SALE_PRICE = .05 ether;

    string private  baseTokenUri;

    enum Step {
        Before,
        Gen1Sale,
        Gen2Sale,
        PublicSale,
        Reveal
    }
    Step public Currentstep;

    bytes32 private gen1MerkleRoot;
    bytes32 private gen2MerkleRoot;

    mapping(address => uint256) public totalPublicMint;
    mapping(address => uint256) public totalGen1Mint;
    mapping(address => uint256) public totalGen2Mint;

    uint private teamLength;
// mettre en constructor :
// - merkleroot gen 1
// - merkleroot gen 2
// - base uri ipfs
// - base uri unrevealed
// - les adresses des teams?
// - les shares des teams?
    constructor(address[] memory _team, uint256[] memory _teamShares) ERC721A("MetaMindGames", "MTMG",MAX_PER_ADRESS_PUBLIC_MINT,MAX_SUPPLY) PaymentSplitter(_team, _teamShares){
        teamLength = _team.length;
    }

    modifier callerIsUser() {
        require(tx.origin == msg.sender, "MetaMindGames :: Cannot be called by a contract");
        _;
    }

    function mint(uint256 _quantity) external payable nonReentrant callerIsUser{
        require(Currentstep == Step.PublicSale || Currentstep == Step.Reveal, "MetaMindGames :: Not Yet Active.");
        require((totalSupply() + _quantity) <= MAX_SUPPLY, "MetaMindGames :: Beyond Max Supply");
        require((totalPublicMint[msg.sender] +_quantity) <= MAX_PER_ADRESS_PUBLIC_MINT, "MetaMindGames :: Already minted 3 times!");
        require(msg.value >= (PUBLIC_SALE_PRICE * _quantity), "MetaMindGames :: Payment is below the price");

        totalPublicMint[msg.sender] += _quantity;
        _safeMint(msg.sender, _quantity);
    }

    function isGen1(address _account, bytes32[] memory _proof) public view returns (bool){
        return MerkleProof.verify(_proof,gen1MerkleRoot,keccak256(abi.encodePacked((_account))));
    }

    function isGen2(address _account, bytes32[] memory _proof) public view returns (bool){
        return MerkleProof.verify(_proof,gen2MerkleRoot,keccak256(abi.encodePacked((_account))));
    }

    function gen1Mint(bytes32[] memory _merkleProof, uint256 _quantity) external payable nonReentrant callerIsUser{
        require(Currentstep == Step.Gen1Sale, "MetaMindGames :: Gen1Mint is not open");
        require((totalSupply() + _quantity) <= MAX_SUPPLY, "MetaMindGames :: Cannot mint beyond max supply");
        require((totalGen1Mint[msg.sender] + _quantity)  <= MAX_PER_ADRESS_GEN1_MINT, "MetaMindGames :: Cannot mint beyond whitelist max mint!");
        require(msg.value >= (GEN1_SALE_PRICE * _quantity), "MetaMindGames :: Payment is below the price");
        bool IS_GEN1 = isGen1(msg.sender,_merkleProof);
        require(IS_GEN1, "MetaMindGames :: You are not whitelisted");

        totalGen1Mint[msg.sender] += _quantity;
        _safeMint(msg.sender, _quantity);
    }

    function gen2Mint(bytes32[] memory _merkleProof, uint256 _quantity) external payable nonReentrant callerIsUser{
        require(Currentstep == Step.Gen2Sale, "MetaMindGames :: Gen2Mint is not open");
        require((totalSupply() + _quantity) <= MAX_SUPPLY, "MetaMindGames :: Cannot mint beyond max supply");
        require((totalGen2Mint[msg.sender] + _quantity)  <= MAX_PER_ADRESS_GEN2_MINT, "MetaMindGames :: Cannot mint beyond whitelist max mint!");
        require(msg.value >= (GEN2_SALE_PRICE * _quantity), "MetaMindGames :: Payment is below the price");
        bool IS_GEN2 = isGen2(msg.sender,_merkleProof);
        require(IS_GEN2, "MetaMindGames :: You are not whitelisted");

        totalGen2Mint[msg.sender] += _quantity;
        _safeMint(msg.sender, _quantity);

    }

    function teamMint(uint256 _quantity) external onlyOwner{
        require((totalPublicMint[msg.sender] +_quantity) <= MAX_TEAM_MINT, "MetaMindGames :: Team already minted!");
        _safeMint(msg.sender, _quantity);
    }

    function gift(address to, uint256 _quantity) external onlyOwner{ 
        require((totalSupply() + _quantity) <= MAX_SUPPLY, "MetaMindGames :: Cannot mint beyond max supply");
        _safeMint(to, _quantity);
    }

    function _baseURI() internal view virtual override returns (string memory) {
        return baseTokenUri;
    }

    //return uri for certain token
    function tokenURI(uint256 tokenId) public view virtual override returns (string memory) {
        require(_exists(tokenId), "ERC721Metadata: URI query for nonexistent token");
        return bytes(baseTokenUri).length > 0 ? string(abi.encodePacked(baseTokenUri, tokenId.toString(), ".json")) : "";
    }

    /// @dev walletOf() function shouldn't be called on-chain due to gas consumption
    function walletOf() external view returns(uint256[] memory){
        address _owner = msg.sender;
        uint256 numberOfOwnedNFT = balanceOf(_owner);
        uint256[] memory ownerIds = new uint256[](numberOfOwnedNFT);

        for(uint256 index = 0; index < numberOfOwnedNFT; index++){
            ownerIds[index] = tokenOfOwnerByIndex(_owner, index);
        }

        return ownerIds;
    }

    function setTokenUri(string memory _baseTokenUri) external onlyOwner{
        baseTokenUri = _baseTokenUri;
    }

    function setGen1MerkleRoot(bytes32 _merkleRoot) external onlyOwner{
        gen1MerkleRoot = _merkleRoot;
    }

    function getGen1MerkleRoot() external view returns (bytes32){
        return gen1MerkleRoot;
    }

    function setGen2MerkleRoot(bytes32 _merkleRoot) external onlyOwner{
        gen2MerkleRoot = _merkleRoot;
    }

    function getGen2MerkleRoot() external view returns (bytes32){
        return gen2MerkleRoot;
    }

    function setStep(uint _step) external onlyOwner {
            Currentstep = Step(_step);
        }

    function withdraw() external onlyOwner{
        for(uint i = 0 ; i < teamLength ; i++) {
                release(payable(payee(i)));
            }
    }
}

